  return (
    
    <Router>
      <Routes>
        <meta name="google-adsense-account" content="ca-pub-1305960827881085"></meta>
        <Route path="/" element={<Home />} />
        <Route path="/resume" element={<ResumeMaker />} />
      </Routes>
    </Router>
  );
}

export default App;
